def is_number(num_str):
    try:
        float(num_str)
        return True
    except ValueError:
        pass

    try:
        import unicodedata
        unicodedata.numeric(num_str)
        return True
    except (TypeError, ValueError):
        pass

    return False


def get_mac_address():
    mac = uuid.UUID(int=(uuid.getnode())).hex[-12:]
    return ':'.join([mac[e:e + 2] for e in range(0, 11, 2)])


